import { BrowserRouter, Route } from "react-router-dom";
import "./App.css";
import Home from "./pages/Home";
import Login from "./pages/Login";
function App() {
  return (
    <div>
      <BrowserRouter>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/Login">
          <Login />
        </Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
